The forged letter (Evidence 1) appears to be a letter written by an unknown person claiming to be Kay, and Simeon in Testimonies 1 and 2 denies instigating murder, and mentions the content ("kill") in the letter, suggesting the letter implies an instigation to murder. However, Simeon first denies any mention of instigating murder, then admits he may have said the word "kill," but claims there is no way to prove it (Testimonies 1, 2, and 3). There is a contradiction here between Simeon's denial and partial admission and the contents of the forged letter.

This is a contradiction between Forged Letter (Evidence 1) and Simeon's Testimony 1 ("I instigated murder? There's not a single word about that in the letter, is there?").

