Evidence 4 describes the omnibus where the crime took place and mentions that there is a bloodstain visible on the frame of the skylight when it's open. This indicates that the skylight had to be open at some point for the bloodstain to be on the frame. 

In contrast, Testimony 3 by Furst states, "The skylight was shut the entire time, I tell you! We couldn't possibly have opened it!" This testimony contradicts the evidence that the skylight was open since there is a bloodstain visible on the skylight frame, indicating it was likely opened.

