The contradiction lies between Evidence 5 (Jackknife) and Testimony 3 (Garrideb). The evidence states that a large folding knife (jackknife) was found lodged in the victim's back, implying this is the murder weapon or involved in the crime. Meanwhile, the Garrideb testimony explicitly says there are plenty of knives around their place, but he can't say if any are missing, implying no particular knife was stolen or used. Additionally, in Testimony 4, Garrideb doubts the knife in the victim's back could be one from their house ("If that bally thing in the victim's back really was one of ours...").

This reflects a contradiction: if Garrideb's house has many knives and some could be missing, it might be possible the murder weapon came from there. But Garrideb denies that the knife found in the victim is from their place, casting doubt on whether the knife evidence can be linked to them. This is a contradiction as Garrideb both admits knives could be missing (implying they could be used in the crime) and denies the murder weapon is theirs.

