Evidence 4, "White Cat Photograph #2 → Pawnbroker's Ticket (Coat)," mentions that there is a bloody fingermark on the redemption ticket that has been identified as Mr Mason's blood. This directly contradicts Testimony 3 by Graydon, who says, "Even if certain parties here present claim that my blood was found at the scene." Graydon denies any blood evidence linking him to the scene, while the evidence shows blood from Mr Mason, not Graydon.

No other direct contradiction appears as clear as this between evidence and testimony.

