Evidence 4 (Poison Article) indicates that poison was stolen from a laboratory at Yumei University, suggesting the involvement of poison in the case. On the other hand, Testimony 1 (Menimemo) states, "Because why would I have bothered to stab the woman if I'd already poisoned her?" which implies that poison was not used or did not play a role in the murder since the stabbing was the main method of attack.

The contradiction arises because the evidence suggests the presence or possibility of poison being used or at least involved, whereas the testimony denies that poisoning was relevant in the murder, focusing only on stabbing.

