Evidence 3 (Mysterious Contraption → Crossbow) reveals a metal folding crossbow found hidden behind a tree under the experimentation stage. However, Testimony 1 by Harebrayne states that the kinesis machine cannot transport metal, so the metal weapon would have stayed put.

These two pieces contradict because if the metal weapon is found hidden away from the main explosion site, yet Harebrayne claims kinesis cannot transport metal, this implies the weapon could not have moved and therefore couldn't account for any perceived movement or placement connected to the explosion and its aftermath.

