The evidence called "Noticeboard" (Evidence 13) is completely covered in notes and articles relating to victims of the Reaper of the Bailey, and it has a bloody handprint on the back. Gossip (Testimony 0) claims to not know anything about the noticeboard and says they only wiped their hand on it. However, later Gossip (Testimony 4) admits it was the Reaper and comments on his face.

This shows some contradiction because Gossip tries to distance themselves from the noticeboard initially but later directly points out the Reaper, which is relevant to the noticeboard's content. The contradiction lies in Gossip's knowledge or involvement with the noticeboard itself and the victim cases it relates to.

