Evidence 11 (Det. Gumshoe's Fingerprints) states that the fingerprints of Det. Gumshoe were left on the hallway bench where he apparently sat and ate a Swiss roll. This suggests that Det. Gumshoe was not guarding the Lobby No. 2 door the entire time as he claimed.

Testimony 3 states that Det. Gumshoe did not take a single step away from the Lobby No. 2 door until he heard the gunshot. This directly conflicts with the presence of his fingerprints on the hallway bench, indicating he must have moved away from guard duty.

